import "./App.css";
import { Component } from "react";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Linda",
        },
        {
          name: "Frank",
        },
        {
          name: "Jacky",
        },
      ]
    };
  }
  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map((monsters) => {
            return <h1>{monsters.name}</h1>
          })
        }
      </div>
    );
  }
}

export default App;
